import React from "react";
import forecastCSS from "../styles/forecast.module.css";
const x2 = ["20", "30", "40", 60, 70];
const x1 = ["0", "20", "30", "40"," 60"];

function graphMaking() {
  for (let i = 0; i < 5; i++) {
    return <line x1={x1[i]} y1={x1[i]} x2={x2[i]} y2={x2[i]} stroke="white" />;
  }
}

function ForecastGraph() {
  return (
    <>
      <svg className={forecastCSS.graph}>
        <line x1={x1[0]} y1={x1[0]} x2={x2[0]} y2={x2[0]} stroke="white" />
        <line x1={x1[1]} y1={x1[1]} x2={x2[1]} y2={x2[1]} stroke="white" />
        <line x1={x1[2]} y1={x1[2]} x2={x2[2]} y2={x2[2]} stroke="white" />
        <line x1={x1[3]} y1={x1[3]} x2={x2[3]} y2={x2[3]} stroke="white" />
        <line x1={x1[4]} y1={x1[4]} x2={x2[4]} y2={x2[4]} stroke="white" />
      </svg>
    </>
  );
}

export default ForecastGraph;
